    <!-- Prefetch and PreconnectDomain name prefetching is a good solution to already resolvedomain
        names before a user actually follows a link. Here anexample how to implement it in the HEAD section
        of your HTML:<link rel="dns-prefetch" href="//www.example.com">The double slashes indicate that
        the URL begins with a hosname (this is specifed in the RFC1808).Preconnect allows the browser to
        set up early connectionsbefore an HTTP reques is actually sent to the server.Connections such
        as DNS Lookup, TCP Handshake, and TLSnegotiation can be initiated beforehand, eliminating
        roundtriplatency for those connections and saving time for users.The example below shows what
        it looks like to enable preconnectfor the zone alias link for KeyCDN.<link href='https://cdn.keycdn.com'
        rel='preconnect' crossorigin>Read our in-depth article on preconnect.
        -->
    <link rel="dns-prefetch" href="//www.example.com" />
